import React from 'react';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import Typography from '@mui/material/Typography';
import { CardActionArea } from '@mui/material';
import ContentBlock from './ContentBlock.js';
import Title from './Title.js';
import '../choose.css';

function ActionAreaCard(props) {
  return (
    <Card className="chooseCard" style={{margin: "1em"}} sx={{ maxWidth: 345 }}>
      <CardActionArea className="chooseCardArea">
        <CardContent className="chooseCardContentArea">
          <Typography className="chooseCardContent" align="center" variant="body1" color="text.secondary" component="div">
            {props.content}
          </Typography>
          <Typography mt="1" align="center" gutterBottom variant="h5" component="div">
            {props.title}
          </Typography>
        </CardContent>
      </CardActionArea>
    </Card>
  );
}

class ChooseBlock extends React.Component {
  constructor(props) {
    super(props);
    this.state = {ideas: null};
  }

  componentDidMount() {
    fetch('/api/get-templates-ideas')
      .then(res => res.json())
      .then(res => console.log(res));
  }

  render() {

    return (
      <ContentBlock>
        <Title content="Choose fresh ideas to do" />
        <div id="choose_list">
          <ActionAreaCard title="Recreational" content="Solve a Rubik's cube" />
          <ActionAreaCard title="Education" content="Learn how to fold a paper crane" />
          <ActionAreaCard title="Busywork" content="Make a bucket list" />
          <ActionAreaCard title="Relaxation" content="Do something you used to do as a kid" />
          <ActionAreaCard title="Music" content="Listen to your favorite album" />
          <ActionAreaCard title="Social" content="Play a game of tennis with a friend" />
          <ActionAreaCard title="Cooking" content="Make bread from scratch" />
          <ActionAreaCard title="Charity" content="Donate blood at a local blood center" />
        </div>
      </ContentBlock>
    )
  }
}

export default ChooseBlock;
